/* eslint-disable no-unused-vars */
import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Grid,
  MenuItem,
  Alert,
  Chip,
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import Layout from '../../components/Layout/Layout';
import DataTable from '../../components/Common/DataTable';
import ConfirmDialog from '../../components/Common/ConfirmDialog';
import LoadingSpinner from '../../components/Common/LoadingSpinner';
import produtoService from '../../services/produtoService';
import { formatCurrency } from '../../utils/formatters';
import { useAuth } from '../../context/AuthContext';

const ProdutosList = () => {
  const [produtos, setProdutos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [dialogOpen, setDialogOpen] = useState(false);
  const [confirmOpen, setConfirmOpen] = useState(false);
  const [selectedProduto, setSelectedProduto] = useState(null);
  const [formData, setFormData] = useState({
    codigo: '',
    nome: '',
    descricao: '',
    precoCusto: '',
    precoVenda: '',
    quantidadeEstoque: '',
    estoqueMinimo: '10',
  });
  const { hasAnyRole } = useAuth();

  const canEdit = hasAnyRole(['ADMIN', 'ESTOQUE_FINANCEIRO']);

  useEffect(() => {
    loadProdutos();
  }, []);

  const loadProdutos = async () => {
    try {
      const data = await produtoService.listarTodos();
      setProdutos(data);
    } catch (err) {
      setError('Erro ao carregar produtos');
    } finally {
      setLoading(false);
    }
  };

  const handleOpenDialog = (produto = null) => {
    if (produto) {
      setSelectedProduto(produto);
      setFormData({
        codigo: produto.codigo,
        nome: produto.nome,
        descricao: produto.descricao || '',
        precoCusto: produto.precoCusto || '',
        precoVenda: produto.precoVenda,
        quantidadeEstoque: produto.quantidadeEstoque,
        estoqueMinimo: produto.estoqueMinimo,
      });
    } else {
      setSelectedProduto(null);
      setFormData({
        codigo: '',
        nome: '',
        descricao: '',
        precoCusto: '',
        precoVenda: '',
        quantidadeEstoque: '0',
        estoqueMinimo: '10',
      });
    }
    setDialogOpen(true);
  };

  const handleCloseDialog = () => {
    setDialogOpen(false);
    setSelectedProduto(null);
  };

  const handleSubmit = async () => {
    try {
      if (selectedProduto) {
        await produtoService.atualizar(selectedProduto.id, formData);
        setSuccess('Produto atualizado com sucesso!');
      } else {
        await produtoService.criar(formData);
        setSuccess('Produto criado com sucesso!');
      }
      handleCloseDialog();
      loadProdutos();
    } catch (err) {
      setError(err.response?.data?.message || 'Erro ao salvar produto');
    }
  };

  const handleDelete = async () => {
    try {
      await produtoService.deletar(selectedProduto.id);
      setSuccess('Produto excluído com sucesso!');
      setConfirmOpen(false);
      loadProdutos();
    } catch (err) {
      setError('Erro ao excluir produto');
    }
  };

  const columns = [
    { field: 'codigo', headerName: 'Código' },
    { field: 'nome', headerName: 'Nome' },
    { field: 'categoriaNome', headerName: 'Categoria' },
    {
      field: 'precoVenda',
      headerName: 'Preço',
      render: (value) => formatCurrency(value),
      align: 'right',
    },
    {
      field: 'quantidadeEstoque',
      headerName: 'Estoque',
      align: 'right',
      render: (value, row) => (
        <Chip
          label={value}
          color={value <= row.estoqueMinimo ? 'error' : 'success'}
          size="small"
        />
      ),
    },
    {
      field: 'ativo',
      headerName: 'Status',
      render: (value) => (
        <Chip
          label={value ? 'Ativo' : 'Inativo'}
          color={value ? 'success' : 'default'}
          size="small"
        />
      ),
    },
  ];

  if (loading) return <Layout><LoadingSpinner /></Layout>;

  return (
    <Layout>
      <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between' }}>
        <Box>
          <Typography variant="h4" gutterBottom>
            Produtos
          </Typography>
          <Typography variant="body2" color="textSecondary">
            Gerenciamento de produtos do sistema
          </Typography>
        </Box>
        {canEdit && (
          <Button
            variant="contained"
            startIcon={<AddIcon />}
            onClick={() => handleOpenDialog()}
          >
            Novo Produto
          </Button>
        )}
      </Box>

      {error && (
        <Alert severity="error" onClose={() => setError('')} sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}
      {success && (
        <Alert severity="success" onClose={() => setSuccess('')} sx={{ mb: 2 }}>
          {success}
        </Alert>
      )}

      <DataTable
        columns={columns}
        data={produtos}
        onEdit={canEdit ? handleOpenDialog : null}
        onDelete={canEdit ? (produto) => {
          setSelectedProduto(produto);
          setConfirmOpen(true);
        } : null}
      />

      {/* Dialog para criar/editar produto */}
      <Dialog open={dialogOpen} onClose={handleCloseDialog} maxWidth="md" fullWidth>
        <DialogTitle>
          {selectedProduto ? 'Editar Produto' : 'Novo Produto'}
        </DialogTitle>
        <DialogContent>
          <Grid container spacing={2} sx={{ mt: 1 }}>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Código"
                value={formData.codigo}
                onChange={(e) => setFormData({ ...formData, codigo: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Nome"
                value={formData.nome}
                onChange={(e) => setFormData({ ...formData, nome: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Descrição"
                value={formData.descricao}
                onChange={(e) => setFormData({ ...formData, descricao: e.target.value })}
                multiline
                rows={2}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Preço de Custo"
                type="number"
                value={formData.precoCusto}
                onChange={(e) => setFormData({ ...formData, precoCusto: e.target.value })}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Preço de Venda"
                type="number"
                value={formData.precoVenda}
                onChange={(e) => setFormData({ ...formData, precoVenda: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Quantidade em Estoque"
                type="number"
                value={formData.quantidadeEstoque}
                onChange={(e) => setFormData({ ...formData, quantidadeEstoque: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Estoque Mínimo"
                type="number"
                value={formData.estoqueMinimo}
                onChange={(e) => setFormData({ ...formData, estoqueMinimo: e.target.value })}
              />
            </Grid>
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancelar</Button>
          <Button onClick={handleSubmit} variant="contained">
            Salvar
          </Button>
        </DialogActions>
      </Dialog>

      {/* Dialog de confirmação para excluir */}
      <ConfirmDialog
        open={confirmOpen}
        title="Confirmar Exclusão"
        message={`Deseja realmente excluir o produto "${selectedProduto?.nome}"?`}
        onConfirm={handleDelete}
        onCancel={() => setConfirmOpen(false)}
      />
    </Layout>
  );
};

export default ProdutosList;
